import { Component } from '@angular/core';
import { Nota } from '../domain/nota';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { NotasService } from '../services/notas.service';
import { NotasFirebaseService } from '../services/notas-firebase.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-crear',
  templateUrl: './crear.component.html',
  styleUrls: ['./crear.component.css']
})
export class CrearComponent {
  formulario: FormGroup;

  constructor(private router: Router ,private fb: FormBuilder, private notasService: NotasService, private notasFirebaseService: NotasFirebaseService) {
    this.formulario = this.fb.group({
      nota: ['', Validators.required],
      fecha: [null, Validators.required],
      etiqueta: ['', Validators.required],
    });
  }

  onSubmit() {
    if (this.formulario.valid) {
      const nota = this.formulario.value as Nota;
      this.notasService.agregarReceta(nota);
      this.notasFirebaseService.save(nota);
      this.formulario.reset();
      }
    }
}

<form [formGroup]="formulario" (ngSubmit)="onSubmit()">
    <div class="form-group">
      <label for="nota">Nota:</label>
      <input type="text" id="nota" formControlName="nota" required>
    </div>

    <div class="form-group">
      <label for="fecha">Fecha:</label>
      <input type="date" id="fecha" formControlName="fecha" required>
    </div>


    <div class="form-group">
      <label for="etiqueta">Etiqueta:</label>
      <textarea id="etiqueta" formControlName="etiqueta" required></textarea>
    </div>

    <button type="submit" [disabled]="formulario.invalid">Agregar Nota</button>
</form>


<form action="" name="Receta" id="form" >

  <label for="txtNota">Ingresar Nota</label>
  <input type="text" name="txtNota" [(ngModel)]="nota.descripcion">

  <label for="txtFecha">Ingresar Fecha</label>
  <input type="text" name="txtFecha" [(ngModel)]="nota.fecha">

  <label for="txtEtiqueta">Ingresar Etiqueta</label>
  <input type="text" name="txtEtiqueta" [(ngModel)]="nota.etiqueta">

  <label for="txtImagen">Ingresar URL de Imagen</label>
  <input type="text" name="txtImagen" [(ngModel)]="nota.imagenUrl">

  <button (click)="saveTarea()">Ingresar</button>
  <button (click)="goListado()">Listar</button>

</form>
